pragma solidity 0.5.7;
pragma experimental ABIEncoderV2;

interface IMarketMaker {

    struct subscriptions{
        address investor;
        address asset;
        bytes32 name;
        uint256 amount;   
        uint256 price;     
    }

    function setRelayer() external;

    function addBroker(string calldata name, address account, bytes32 broker) external;

    function make(address owned, bytes32 isin, uint offered, address tomatch, uint desired, uint min, uint minSubscription) external;

    function issue(address security, uint256 cutoffTime) external;

    function subscribe(bytes32 poolId, address assetIn, bytes32 assetName, uint256 amount, address investor) external;

    function close(address security) external returns(bytes32[] memory);

    function getSubscribers(bytes32 poolId) external returns(subscriptions[] memory);

    function accept(bytes32 poolId, address investor, uint256 amount, address asset) external;

    function refund(bytes32 poolId, address investor, uint256 amount, address asset) external;

    function reject(bytes32 poolId, address investor) external;

    function settle(bytes32 poolId) external;

    function withdraw(address security, uint amount) external;

}
